import React from 'react';
import Carou from './Carou';

const Carousel = () => {
  return (
    <div className="bg-gray-200 h-screen flex items-center justify-center">
      <Carou>
        <div className="bg-gray-400 h-64 flex items-center justify-center">
          Item 1
        </div>
        <div className="bg-gray-500 h-64 flex items-center justify-center">
          Item 2
        </div>
        <div className="bg-gray-600 h-64 flex items-center justify-center">
          Item 3
        </div>
        <div className="bg-gray-700 h-64 flex items-center justify-center">
          Item 4
        </div>
      </Carou>
    </div>
  );
};

export default Carousel;
